<!DOCTYPE html>
<html lang="ar" dir="rtl">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0, maximum-scale=1.0, user-scalable=no">
    <title>الطلبات</title>
    <link href="https://fonts.googleapis.com/css2?family=Tajawal:wght@400;500;700&display=swap" rel="stylesheet">
    <link rel="stylesheet" href="https://cdnjs.cloudflare.com/ajax/libs/font-awesome/6.0.0/css/all.min.css">
    <style>
        :root {
            --bg-primary: #1a1d25;
            --bg-secondary: #1a1d25;
            --text-primary: #fff;
            --text-secondary: #a0a0a0;
            --accent-green: #fff;
            --accent-green-light: #326fa8;
            --glass-background: rgba(0, 0, 0, 0.35);
            --glass-border: #;
        }

        * {
            margin: 0;
            padding: 0;
            box-sizing: border-box;
            -webkit-tap-highlight-color: transparent;
        }

        body {
            font-family: 'Tajawal', sans-serif;
            background: #1a1d25;
            color: var(--text-primary);
            line-height: 1.6;
            min-height: 100vh;
            display: flex;
            justify-content: center;
            align-items: center;
            padding: 1rem;
            perspective: 1000px;
            overflow: hidden;
        }

        .order-tracking-container {
            background: var(--glass-background);
            backdrop-filter: blur(20px);
            border-radius: 40px;
            padding: 2rem;
            width: 100%;
            max-width: 500px;
            border: 1px solid var(--glass-border);
            position: relative;
            overflow: hidden;
            box-shadow: 0 20px 50px rgba(0,0,0,0.2);
            transform-style: preserve-3d;
            transform: rotateX(10deg) scale(0.9);
            opacity: 0;
            transition: all 1s cubic-bezier(0.25, 0.1, 0.25, 1);
        }

        .order-tracking-container.loaded {
            transform: rotateX(0) scale(1);
            opacity: 1;
        }

        .background-glow {
            position: absolute;
            top: -50%;
            left: -50%;
            width: 200%;
            height: 200%;
            background: #333333;
            animation: glow-pulse 5s infinite alternate;
            z-index: -1;
        }

        .order-header {
            text-align: center;
            margin-bottom: 2rem;
            position: relative;
        }

        .order-header h1 {
            font-size: 2.5rem;
            background: linear-gradient(45deg, var(--accent-green), var(--text-primary));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
            margin-bottom: 0.5rem;
            opacity: 0;
            transform: translateY(20px);
            transition: all 1s cubic-bezier(0.25, 0.1, 0.25, 1);
        }

        .order-header.loaded h1 {
            opacity: 1;
            transform: translateY(0);
        }

        .order-header h3 {
            color: var(--text-secondary);
            font-weight: 300;
            opacity: 0;
            transform: translateY(20px);
            transition: all 1s cubic-bezier(0.25, 0.1, 0.25, 1) 0.3s;
        }

        .order-header.loaded h3 {
            opacity: 1;
            transform: translateY(0);
        }

        .order-details {
            display: flex;
            justify-content: center;
            margin-bottom: 2rem;
        }

        .order-detail {
            background: var(--glass-background);
            border: 1px solid var(--glass-border);
            border-radius: 30px;
            padding: 2rem;
            text-align: center;
            width: 100%;
            max-width: 300px;
            position: relative;
            overflow: hidden;
            opacity: 0;
            transform: translateY(30px);
            transition: all 1s cubic-bezier(0.25, 0.1, 0.25, 1) 0.6s;
        }

        .order-details.loaded .order-detail {
            opacity: 1;
            transform: translateY(0);
        }

        .order-detail i {
            font-size: 2.5rem;
            margin-bottom: 1rem;
            background: linear-gradient(45deg, var(--accent-green), var(--text-primary));
            -webkit-background-clip: text;
            -webkit-text-fill-color: transparent;
        }

        .count {
            display: flex;
            justify-content: center;
            align-items: center;
            gap: 0.5rem;
            font-size: 2.5rem;
            font-weight: bold;
        }

        .count-number {
            position: relative;
            width: 60px;
            height: 70px;
            perspective: 400px;
            overflow: hidden;
        }

        .count-number span {
            position: absolute;
            width: 100%;
            height: 100%;
            display: flex;
            justify-content: center;
            align-items: center;
            color: var(--accent-green-light);
            transform: rotateX(90deg);
            opacity: 0;
            transition: all 0.8s cubic-bezier(0.175, 0.885, 0.32, 1.275);
        }

        .count-number.active span {
            transform: rotateX(0);
            opacity: 1;
        }

        .action-buttons {
            display: flex;
            justify-content: center;
        }

        .btn {
            display: inline-flex;
            align-items: center;
            justify-content: center;
            gap: 0.5rem;
            font-family: 'Tajawal', sans-serif;
            font-size: 1.2rem;
            padding: 1rem 2rem;
            background: var(--accent-green);
            color: #000;
            text-decoration: none;
            border-radius: 50px;
            transition: all 0.3s ease;
            opacity: 0;
            transform: translateY(30px);
            transition: all 1s cubic-bezier(0.25, 0.1, 0.25, 1) 0.9s;
        }
        
        .btn:hover {
  background-color: #326fa8;
} 

        .action-buttons.loaded .btn {
            opacity: 1;
            transform: translateY(0);
        }

        @keyframes glow-pulse {
            0% { transform: scale(1); opacity: 0.7; }
            100% { transform: scale(1.1); opacity: 0.9; }
        }

        @media (max-width: 768px) {
            .order-tracking-container {
                padding: 1.5rem;
                margin: 0;
                max-width: 100%;
                border-radius: 20px;
            }

            .order-header h1 {
                font-size: 2rem;
            }

            .order-detail {
                padding: 1.5rem;
            }

            .count {
                font-size: 2rem;
            }

            .count-number {
                width: 50px;
                height: 60px;
            }

            .btn {
                font-size: 1rem;
                padding: 0.75rem 1.5rem;
            }
        }

        @media (max-width: 375px) {
            .order-tracking-container {
                padding: 1rem;
            }

            .order-header h1 {
                font-size: 1.8rem;
            }

            .count {
                font-size: 1.8rem;
                gap: 0.3rem;
            }

            .count-number {
                width: 40px;
                height: 50px;
            }

            .btn {
                font-size: 0.9rem;
                padding: 0.6rem 1.2rem;
            }
        }
    </style>
</head>
<body>
    <div class="background-glow"></div>
    <div class="order-tracking-container">
        <div class="order-header">
            <h1>U p T i m e</h1>
            <h3></h3>
        </div>

        <div class="order-details">
            <div class="order-detail">
                <i class="fa-regular fa-star-half-stroke"></i>
                <h3>الطلبات حاليا</h3>
                <div class="count">
                    <div class="count-number" id="firstNumber">
                        <span>0</span>
                    </div>
                    <div>/</div>
                    <div class="count-number" id="secondNumber">
                        <span>0</span>
                    </div>
                </div>
            </div>
        </div>

        <div class="action-buttons">
            <a href="https://uptimeser.github.io/" class="btn">
                <i class="fa-regular fa-paper-plane"></i> اطلب الان! 
            </a>
        </div>
    </div>
